import React from "react";
import styled from "styled-components";

const StyledLocal = styled.div`
  border: 1px solid black;
  border-radius: 6px;
  width: 30%;
  margin: 1%;
  height: 300px;
`;

export default function Local() {
  return (
    <StyledLocal>
      <h1>nombre</h1>
    </StyledLocal>
  );
}
